<template>
    <div>
        <div class="rotation-container">
            <vue-slider v-model="rotation" :min="0" :max="360" :interval="1" tooltip="none" />
        </div>

        <div class="shop-container">
            <div class="header">
                <img
                    alt="logo"
                    width="200"
                    src="data:img/png;base64,"
                />
            </div>

            <hr>

            <div class="body">
                <p>
                    Unser Katalog
                </p>

                <div v-if="currentCategory !== null" class="category-actions">
                    <a href="#" @click="deselectZone" class="category-back">
                        <i class="fas fa-angle-left"></i>
                    </a>

                    {{ categories[currentCategory] }}
                </div>

                <div class="list">
                    <ul v-if="currentCategory === null">
                        <li
                            class="clearfix"
                            v-for="(categoryName, categoryId) in categories"
                            :key="categoryId"
                            v-if="categoryId !== 6 && categoryId !== 7"
                        >
                            <a href="#" @click="selectCategory(categoryId)">
                                {{ categoryName }}
                            </a>
                        </li>
                    </ul>

                    <div
                        class="loading-container"
                        style="min-height: 200px"
                        v-if="currentCategory !== null && tattoos === null"
                    >
                        <div class="loader">
                            <div class="lds-dual-ring"></div>
                        </div>
                    </div>

                    <div v-if="currentCategory !== null && (tattoos !== null && tattoos.length === 0)">
                        In diesem Tattoo Shop gibt es keine Tattoos in dieser Kategorie.
                    </div>

                    <ul class="tattoo-list" v-if="currentCategory !== null && tattoos !== null && tattoos.length > 0">
                        <li class="clearfix" v-for="(tattoo, k) in tattoos" :key="k">
                            <a class="label" href="#" @click="previewTattoo(k)">
                                {{ tattoo.Name }}
                            </a>

                            <span class="price">
                                {{ formatPrice(tattoo.Price) }}
                            </span>

                            <span class="zone">
                                {{ categories[tattoo.ZoneId] }}
                            </span>
                        </li>
                    </ul>
                </div>
            </div>

            <hr>

            <p class="info" v-if="currentTattoo !== null">
                Ausgewähltes Tattoo: {{ currentTattoo.Name }}
            </p>

            <div class="actions">
                <a class="leave" href="#" @click="dismiss">
                    Verlassen
                </a>

                <a class="buy" href="#" @click="buy" :disabled="currentTattoo === null">
                    Kaufen
                </a>
            </div>
        </div>
    </div>
</template>

<script>
import Windows from '../windows'
import VueSlider from 'vue-slider-component'
import 'vue-slider-component/theme/antd.css'

export default Windows.register({
    name: 'TattooShop',

    components: {
        VueSlider,
    },

    props: {
        data: String,
    },

    data () {
        return {
            tattoos        : JSON.parse(this.data).tattoos,
            currentTattoo  : null,
            currentCategory: null,
            rotation       : 0,
            loaded         : {
                0: JSON.parse(this.data).tattoos,
            },
            categories     : [
                'Brust', // 0
                'Kopf', // 1
                'Linker Arm', // 2
                'Rechter Arm', // 3
                'Linkes Bein', // 4
                'Rechtes Bein', // 5
                'Unbekannt', // 6
                'Keine', // 7
                'Rücken', // 8
                'Haare', // 9
            ],
        }
    },

    watch: {
        rotation () {
            this.rotate()
        },
    },

    methods: {
        /**
         * Preview the tattoo with the given idx from the list.
         *
         * @param idx
         */
        previewTattoo (idx) {
            let tattoo

            if (idx < 0 || idx > this.tattoos.length) return

            tattoo = this.tattoos[idx]

            this.trigger('resetTattoos', JSON.stringify({ 'hash': tattoo.TattooHash }))
            this.triggerServer('syncTattoo', tattoo.TattooHash)

            this.currentTattoo = tattoo
        },

        /**
         * Request tattoos for the given category from the server.
         */
        selectCategory (idx) {
            this.currentCategory = idx
            this.tattoos         = null

            this.trigger('zoneSelected', idx)

            if (this.loaded.hasOwnProperty(idx)) {
                this.responseTattooShopCategory(JSON.stringify(this.loaded[idx]))

                return
            }

            this.triggerServer('requestTattooShopCategoryTattoos', idx)
        },

        /**
         * Reset a zone selection.
         */
        deselectZone () {
            this.currentCategory = null

            this.trigger('zoneSelected', null)
        },

        /**
         * Callback if the server responses.
         */
        responseTattooShopCategory (tattooJson) {
            // If the player has been left the category before it has been loaded, simply do nothing.
            if (this.currentCategory === null) return

            this.tattoos = JSON.parse(tattooJson)
        },

        /**
         * Buy the last previewed tattoo.
         */
        buy () {
            if (this.currentTattoo === null) return

            this.triggerServer('tattooShopBuy', this.currentTattoo.TattooHash)

            this.dismiss()
        },

        /**
         * Rotate the player.
         */
        rotate () {
            this.trigger('rotate', this.rotation)
        },

        /**
         * Close the shop.
         */
        dismiss () {
            this.dismiss()
        },

        /**
         * Format the price according to us currency rules.
         *
         * @param price
         *
         * @returns {string}
         */
        formatPrice (price) {
            return Number(price).toLocaleString(
                'en-US',
                {
                    style                : 'currency',
                    currency             : 'USD',
                    minimumFractionDigits: 0,
                },
            )
        },
    },
})
</script>

